import React, { Component } from "react";
import logo from "./logo.svg";
import "./App.css";

class App extends Component {
  render() {
    return (
      <div
        className="App"
        style={{
          backgroundColor: "#000",
          display: "block",
          color: "#fff",
          fontSize: "4vw",
          paddingLeft: 15
        }}
      >
        <table>
          <tbody>
            <tr>
              <td>
                <img width="100" src="https://api.nasa.gov/images/logo.png" />
              </td>
              <td>NASA Images</td>
            </tr>
          </tbody>
        </table>
      </div>
    );
  }
}

export default App;
